properties.css:
.ui-welcome {
    text-align: center;
}

body#welcome:not(#login) #content > main > .ui-html {
    opacity: unset !important;
}

.page-nav-panel.top span {
    color: #000 !important;
}

#header-name {
    padding: unset !important;
}

.container-fluid {
    padding-left: unset !important;
}

div#header-name img {
    max-height: 55px;
    display: inline-block;
    margin-bottom: 10px;
    /* width: 300px !important; */
    border: 1px solid #9b9b9b !important;
    border-bottom-right-radius: 100px 85px !important;
    background-color: white !important;
    box-shadow: 13px 0px 0px 0px #888 !important;
    padding-right: 25px;
}

.navbar nav#navigation span {
    color: #000;
}

header.navbar {
    background-color: #fff;
}

body.horizontal_menu.inline_menu #sidebar {
    background: #fff;
}

header.navbar .header-nav {
    background-color: #fff;
}

header.navbar .header-nav .nav>li>a i {
    font-size: 24px;
    line-height: 36px;
    color: #000;
}

header.navbar a {
    color: #000;
}

body.horizontal_menu.inline_menu #sidebar .nav > li ul {
    background: #fff !important;
}

header.navbar {
    box-shadow: 0 2px 5px rgb(0 0 0 / 27%) !important;
}

body#welcome div#main {
    background: unset !important;
}

div#footer-message {
    display: none;
}

body#welcome:not(#login) #content > main > .ui-html {
    border:unset;
}

header.navbar {
    height: 58px !important;
}

header.navbar .header-nav {
    padding: 13px 0 0px !important;
}
